import React from 'react'
import video from 'D:/Educat courses/Практика_Educat/React JS Создание страницы educat.courses/Проект/my-app-1/public/Videos/Mountain.mp4'





const Video=()=>{
    return(
        <video autoPlay={true} controls={true} loop={true} id="intro">
            <source src={video} type="video/mp4" />
        </video>



    );
}
export  default Video;
